import { useContext, useEffect, useState } from 'react';
import { Provider, useSelector } from 'react-redux';
import { getMachineConfig } from 'store/machine/machine.selectors';
import store from 'store/store';

function App() {
  const machineConfig = useSelector(getMachineConfig);


  return (
    <>
        <div className="App">Chhavi -- {machineConfig?.[0].equipmentHeader.OEMName}</div>
        <div className="App">Chhavi -- {machineConfig?.[0].fuelUsed.fuelConsumed}</div></>
  );
}

export default App;
